  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(CancelledByUser value)? cancelledByUser,
    TResult Function(FileNotFound value)? fileNotFound,
    TResult Function(Unauthorized value)? unauthorized,
    TResult Function(Unauthenticated value)? unauthenticated,
    TResult Function(NoInternetConnection value)? noInternetConnection,
    TResult Function(NoServiceFound value)? noServiceFound,
    TResult Function(InvalidInput value)? invalidInput,
    TResult Function(UnknownError value)? unknownError,
    TResult Function(BadRequest value)? badRequest,
    TResult Function(CouldnotLogout value)? CouldnotLogout,
    required TResult orElse(),
  }) {
    if (CouldnotLogout != null) {
      return CouldnotLogout(this);
    }
    return orElse();
  }
}

abstract class CouldnotLogout implements UserRoleFailure {
  const factory CouldnotLogout() = _$CouldnotLogout;
}
